function Track(songName, singer, album, type) {
  return (
    <div className="Track">
      <h4 className="SongName">{songName} <span onClick={AddToPlaylist} className="type">{type ? "+" : "-"}</span></h4>
      <p className="SongInfo">{singer} | {album}</p>
    </div>
  );
}

function AddToPlaylist() {
  const current_track = Track("bad ones", "Tate Mcrae", "Too Young to Be Sad", false);
  document.getElementsByClassName('Playlist')[0].innerHTML += current_track[1];
}

export default Track;
